country => {
  let averages = Data.GetUsersOfCountry("Portugal").map(u => {
    let x = {};
    Data.GetCategories().forEach(c => {
      let sum = 0;
      u.Averages.forEach(a => sum += a[c]);
      x[c] = sum / u.Averages.length;
    });
    return x;
  });
  return averages;
}

